import React from 'react'
import { Arrow90degUp, ArrowRight, List, X } from "react-bootstrap-icons";
import Header from '../component/Header';
import { useSwipeable } from "react-swipeable";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import "swiper/css/scrollbar";
import { Autoplay } from 'swiper/modules';
function About() {

    return (
        <>
        <Header/>

        <section>
            <div className="container">
                <div className="about-team d-flex justify-content-center">
                    <p>
                    Hi there! I’m Finnegan Manroe, a passionate photographer based in the vibrant city of Seattle. 
                    With over a decade of experience behind the lens, I specialize in capturing the unique beauty of life’s
                     fleeting moments, from intimate portraits and breathtaking landscapes to dynamic product shots and lively events.
                    </p>
                </div>
                <div className="abt-slide">
                    <div className="row">
                        <div className="col-lg-6">
                            <div className="abt-image">

                            </div>
                        </div>
                      
                    </div>
                </div>
            </div>
        </section>

  


        
           
        </>
    )
}

export default About
